// Home.tsx
import React, {useState} from 'react';
import About from './About';
import Main from './Main';
import "../css/gravity.css"
import gravity2 from "../img/gravity2.jpg"
import gravity from "../img/gravity.webp"
import { Link, Route, Router, Routes } from 'react-router-dom';

function Home() {
    const [currentPage, setPage] = useState("");

    const renderPage = () => {
        switch(currentPage){
            case "about":
                return <About />;
            case "main":
                return <Main />;
            default:
               return <>
                    <div>
                        <button onClick={() => setPage("main")}>メイン</button>
                        <Routes>
                            <Route path="/" Component={Main}/>
                        </Routes>
                        <div className='imgs'>
                            <img className="main" src={gravity}></img>
                            <img className='main' src={gravity2}></img>
                        </div>
                    </div>
                </>
        }
    }

    return (
        <>
            {renderPage()}
        </>
    );
}

export default Home;
